import React from 'react';
import { Text, View, StyleSheet, TouchableOpacity, Image, StatusBar, ScrollView } from 'react-native';
import SettingItem from '../Components/SettingItem';

function SettingScreen(props) {
    return (
        <View>
            <View style= {styles.profileContainer}>
                <View style={styles.profileTextContainer}>
                    <Text style={[styles.profileText, {fontWeight: "bold"}]}>Abdul Saboor</Text>
                    <Text style={styles.profileText}>absaboor019@gmail.com</Text>
                    <Text style={styles.profileText}>03367307051</Text>
                    <TouchableOpacity onPress={()=> console.log("Go To Edit")}>
                        <Text style={[styles.profileText, {fontWeight: "bold"}]}>Edit Profile</Text>
                    </TouchableOpacity>
                </View>
                <View style={styles.profileImageContainer}>
                    <Image style={styles.setImage} source={require("../assets/icon.png")} />
                </View>
            </View>
            <ScrollView>
                <View style={styles.itemContainer}>
                    <Text style={styles.itemText}>General</Text>
                    <SettingItem title={"Your Favourite"} IconName={"heart"} size={20} />
                    <SettingItem title={"My Order"} IconName={"shopping-cart"} size={20} />
                    <SettingItem title={"Payment"} IconName={"credit-card"} size={20} />
                    <SettingItem title={"Edit Profile"} IconName={"user-edit"} size={20} />
                    <SettingItem title={"Change Password"} IconName={"user-lock"} size={20} />
                    <SettingItem title={"About us"} IconName={"info-circle"} size={20} />
                    <SettingItem title={"Contact us"} IconName={"phone-alt"} size={20} />
                    <SettingItem title={"Term & Condition"} IconName={"file-contract"} size={20} />
                    <SettingItem title={"Setting"} IconName={"wrench"} size={20} />
                    <SettingItem title={"Help & Support"} IconName={"headphones"} size={20} />
                    <SettingItem title={"Logout"} IconName={"power-off"} size={20} />
                </View>
            </ScrollView>
        </View>
    );
}

const styles = StyleSheet.create({
    profileContainer: {
        padding: 15,
        paddingTop: 0,
        backgroundColor: "#61dafb",
        flexDirection: 'row',
    },
    profileTextContainer: {
        width: "68%",
        marginLeft: 15,
        flexDirection: "column",
    },
    profileText: {
       fontSize: 16,
    },
    profileImageContainer: {
        flexDirection: "column",
    },
    setImage: {
        width: 88,
        height: 88,
        borderRadius: 10,
    },
    itemContainer: {
        marginTop: 10,
    },
    itemText: {
        marginLeft: 20,
        fontSize: 18,
        marginBottom: 10,
    }
})

export default SettingScreen;
